    <script src="https://unpkg.com/leaflet@1.9.3/dist/leaflet.js"
        integrity="sha256-WBkoXOwTeyKclOHuWtc+i2uENFpDZ9YPdf5Hf+D7ewM=" crossorigin=""></script>
    <script>
        @if (session('errors'))
            $.Toast("Pesan Peringatan", "{{ $errors->first() }}", "error");
        @elseif (session('success'))
            $.Toast("Pesan", "{{ session('success') }}", "success");
        @endif
        let realLatLng = [
            parseFloat('{{ Auth::user()->latitude }}'),
            parseFloat('{{ Auth::user()->longitude }}')
        ];
        var map = L.map('map').setView(realLatLng, 13);
        googleTerrain = L.tileLayer('http://{s}.google.com/vt/lyrs=p&x={x}&y={y}&z={z}', {
            maxZoom: 30,
            subdomains: ['mt0', 'mt1', 'mt2', 'mt3']
        }).addTo(map);
        let icon = L.icon({
            iconUrl: '{{ url('/') }}/icons/pin-red.png',

            iconSize: [25, 25], // size of the icon
            shadowSize: [50, 64], // size of the shadow
            iconAnchor: [12, 25], // point of the icon which will correspond to marker's location
            shadowAnchor: [4, 62], // the same for the shadow
            popupAnchor: [0, -20] // point from which the popup should open relative to the iconAnchor
        });
        let circle = L.circle(realLatLng, {
            color: 'pink',
            fillColor: '#f03',
            fillOpacity: 0.4,
            radius: 200
        }).addTo(map);
        let marker = L.marker(realLatLng, {
            icon
        }).addTo(map);
        let popupContent = `<b>{{ Auth::user()->name }}</b><br>(Telp: {{ Auth::user()->phonenumber }})<br>
                         {{ Auth::user()->address }}<br>
                         `;
        marker.bindPopup(popupContent).openPopup();

        map.on("mouseover", function(ev) {
            $("#layerMap").show(500);
        })

        $("#layerMap").on("mouseleave", function() {
            $("#layerMap").hide(200);
        });

        const openModalLogout = () => {
            $("#modalLogout").removeClass("bottom-[-500px]");
            $("#modalLogout").addClass("bottom-0");
        }

        const logout = () => {
            $("#formLogout").submit();
        }

        const closeModalLogout = () => {
            $("#modalLogout").removeClass("bottom-0");
            $("#modalLogout").addClass("bottom-[-500px]");
        }
    </script>
@endsection
